import 'markup.html';
import { print, clear } from 'out.js';
/* ================================= */


print('Initial commit');

const out = document.getElementById('out');

export function clear() {
  out.textContent = '';
}

export function print(val) {
  out.textContent += '\n' + JSON.stringify(val, null, 2);
}

export default {
  clear,
  print,
}

